import React from 'react';
import './Login.css';
import { Row, Button, Jumbotron, Card, Accordion, Container, ListGroup, Form, Navbar, Nav, FormControl, Col, InputGroup } from 'react-bootstrap';

export default function Login() {
    return (
        <Jumbotron fluid>
            <Container className="boxLogin">
                <InputGroup className="mb-3">
                    <Navbar bgh="ligth" expand="lg" className="navBar shadow">
                        <Navbar.Brand><h2>LISTA DE ALUNOS</h2></Navbar.Brand>
                    </Navbar>
                </InputGroup>
            </Container>
        </Jumbotron>
    );
}
